import React from 'react';
import Header from '../header/Header';
import "./hero.css"

const Hero = () => {
    return (
        <div className='hero'>
            <div className='left-hero'>
                <Header />

            </div>
            <div className='right-hero'></div>
        </div>
    );
};

export default Hero;
